import React, { useState } from "react";
import HeaderNavSort from "./HeaderNavSort";
function HeaderNavList() {
   const category = ["Распродажа", "Новинки", "Одежда", "Обувь", "Модно в этом году",
      "Бренды", "Всё"]
   return (
      <div>
         <nav class="nav">
            <ul class="nav__list">
               {category.map((item, i) => {
                  return (
                     <li class="nav__item">
                        <a href="#" class="nav__link" key={i}>{item}</a>
                        <HeaderNavSort />
                     </li>)
               })}

            </ul>
         </nav>
      </div>
   )
}
export default HeaderNavList
